
function switchTraverse(propList, execFn, map, level=0){
	if(level == propList.length){
		execFn.call(this, Array.from(map.keys()));
		return;
	}
	let prop = propList[level];
	for(let [k, v] of map){
		this[prop] = k;
		switchTraverse.call(this, propList, execFn, v, level + 1);
	}
}

module.exports = switchTraverse;